import LoginPage from './views/login/components/LoginPage'
import HomePage from './views/dashboard/components/HomePage'

import { BrowserRouter as Router,  Routes, Route } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Router>

          <Route path="/home-page">
            <HomePage />
          </Route>
          <Route path="/">
            <LoginPage />
          </Route>
          /home-page/home-page
     </Router>
  </div>


  );

}

export default App;
